import React from 'react';
import Hero from './Hero';
import Ticket from './Ticket';
import Navbar from '../Navbar';
import Footer from '../Footer';

function SupportPage() {
    return (  
        <>
        <Navbar />
        <Hero />
        <Ticket />
        <Footer />
        </>
    );
}

export default SupportPage;
